import { Route, Router, Routes } from 'react-router-dom'
import { ROUTERS } from './utils/router'
import HomePage from './pages/user/HomePage'
import Main from './pages/user/layouts/Main'
import MenuPage from './pages/user/MenuPage'
import { HotPage } from './pages/user/HotPage'
import Sidebar from './pages/admin/layouts/Sidebar'
import AdminLogin from './pages/admin/AdminLogin'
import Dashboard from './pages/admin/Dashboard'
import AdminMain from './pages/admin/layouts/AdminMain'
import PrivateRoutes from './pages/admin/layouts/PrivateRoutes'
import PublicRoutes from './pages/admin/layouts/PublicRoutes'
const userRouter = () => {
    const userRouters = [{
        path: ROUTERS.USER.HOME,
        component: <HomePage/>
    },
    {
        path: ROUTERS.USER.MENU,
        component: <MenuPage/>
    },
    {
        path: ROUTERS.USER.HOT,
        component: <HotPage/>
    }
    ]
  return (
    <Main>
        <Routes>
            {userRouters.map((item,key) => (
                <Route key={key} path={item.path} element = {item.component}/>
            ))}
        </Routes>
    </Main>
  )
};
const adminRouter = () => {
    return (
        <Routes>
            <Route element={<AdminMain/>}>
            <Route element={<PrivateRoutes/>}>
                <Route path='/admin' element={<Dashboard/>}/>
            </Route>
            </Route>
            <Route element={<PublicRoutes/>}>
            <Route path='/admin/login' element={<AdminLogin/>}/>
            </Route>
        </Routes>
    );
};
const RouterCustom = ()=>{
    return(
        <div>
            {userRouter()}
            {adminRouter()}
        </div>
    
    )
};

export default RouterCustom;
